import React from 'react';
import {BrowserRouter as Router,Switch,Route} from 'react-router-dom'; 
import First from './components/First';
import Second from './components/Second';
import './App.css';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route exact path="/" component={()=>{return <First />}} />
          <Route path="/second" component={()=>{return <Second />}} /> 
        </Switch>
      </Router>
    </div>
  );
}

export default App;
